```

0:1027:943.docs:
Makes a new `NaiveDateTime` from date and time components.
Equivalent to [`date.and_time(time)`](./struct.NaiveDate.html#method.and_time)
and many other helper constructors on `NaiveDate`.

# Example

```
use chrono::{NaiveDate, NaiveTime, NaiveDateTime};

let d = NaiveDate::from_ymd_opt(2015, 6, 3).unwrap();
let t = NaiveTime::from_hms_milli_opt(12, 34, 56, 789).unwrap();

let dt = NaiveDateTime::new(d, t);
assert_eq!(dt.date(), d);
assert_eq!(dt.time(), t);
```

2:12039:12014.docs:
Returns an iterator over the [`char`]s of a string slice, and their
positions.

As a string slice consists of valid UTF-8, we can iterate through a
string slice by [`char`]. This method returns an iterator of both
these [`char`]s, as well as their byte positions.

The iterator yields tuples. The position is first, the [`char`] is
second.

# Examples

Basic usage:

```
let word = "goodbye";

let count = word.char_indices().count();
assert_eq!(7, count);

let mut char_indices = word.char_indices();

assert_eq!(Some((0, 'g')), char_indices.next());
assert_eq!(Some((1, 'o')), char_indices.next());
assert_eq!(Some((2, 'o')), char_indices.next());
assert_eq!(Some((3, 'd')), char_indices.next());
assert_eq!(Some((4, 'b')), char_indices.next());
assert_eq!(Some((5, 'y')), char_indices.next());
assert_eq!(Some((6, 'e')), char_indices.next());

assert_eq!(None, char_indices.next());
```

Remember, [`char`]s might not match your intuition about characters:

[`char`]: prim@char

```
let yes = "yes";

let mut char_indices = yes.char_indices();

assert_eq!(Some((0, 'y')), char_indices.next()); // not (0, 'y')
assert_eq!(Some((1, '\u{0306}')), char_indices.next());

// note the 3 here - the last character took up two bytes
assert_eq!(Some((3, 'e')), char_indices.next());
assert_eq!(Some((4, 's')), char_indices.next());

assert_eq!(None, char_indices.next());
```

0:791.docs:
Parsing a `str` into a `Weekday` uses the format [`%W`](./format/strftime/index.html).

# Example

```
use chrono::Weekday;

assert_eq!("Sunday".parse::<Weekday>(), Ok(Weekday::Sun));
assert!("any day".parse::<Weekday>().is_err());
```

The parsing is case-insensitive.

```
# use chrono::Weekday;
assert_eq!("mON".parse::<Weekday>(), Ok(Weekday::Mon));
```

Only the shortest form (e.g. `sun`) and the longest form (e.g. `sunday`) is accepted.

```
# use chrono::Weekday;
assert!("thurs".parse::<Weekday>().is_err());
```

0:1129.docs:
The `Display` output of the naive date and time `dt` is the same as
[`dt.format("%Y-%m-%d %H:%M:%S%.f")`](crate::format::strftime).

It should be noted that, for leap seconds not on the minute boundary,
it may print a representation not distinguishable from non-leap seconds.
This doesn't matter in practice, since such leap seconds never happened.
(By the time of the first leap second on 1972-06-30,
every time zone offset around the world has standardized to the 5-minute alignment.)

# Example

```
use chrono::NaiveDate;

let dt = NaiveDate::from_ymd_opt(2016, 11, 15).unwrap().and_hms_opt(7, 39, 24).unwrap();
assert_eq!(format!("{}", dt), "2016-11-15 07:39:24");
```

Leap seconds may also be used.

```
# use chrono::NaiveDate;
let dt = NaiveDate::from_ymd_opt(2015, 6, 30).unwrap().and_hms_milli_opt(23, 59, 59, 1_500).unwrap();
assert_eq!(format!("{}", dt), "2015-06-30 23:59:60.500");
```

2:12138:39199.docs:
Return an iterator that escapes each char in `self` with [`char::escape_debug`].

Note: only extended grapheme codepoints that begin the string will be
escaped.

# Examples

As an iterator:

```
for c in "\n!".escape_debug() {
    print!("{c}");
}
println!();
```

Using `println!` directly:

```
println!("{}", "\n!".escape_debug());
```


Both are equivalent to:

```
println!("\\n!");
```

Using `to_string`:

```
assert_eq!("\n!".escape_debug().to_string(), "\\n!");
```

